1	第１回ゲームプログラミング勉強会	# この勉強会は延期になりました。\r\n# ご迷惑をおかけしますが、\r\n# 再び日程を調整するまでお待ちください。\r\n\r\n## 概要\r\n\r\n２日間を通して、ゲーム作成の基礎から実践まで\r\nみんなで一緒に勉強しましょう。\r\n\r\n初日は基礎の基礎から勉強し、\r\n２日目はチームに分かれてハッカソン形式で学んだことを実践します。\r\n\r\n## タイムテーブル\r\n\r\n### 【24日】\r\n\r\n| 時間                | 内容\r\n|:----------------|:----------------|\r\n| 9:30                | 渋谷駅集合 |\r\n| 10:00 - 13:30   | enchant.js講習 |\r\n| 13:30 - 14:30   | お昼休み |\r\n| 14:30 - 17:30   | サンプルゲームプログラミング |\r\n| 17:30 - 19:00   | チームビルディング・企画決定 |\r\n\r\n### 【25日】\r\n\r\n| 時間                | 内容\r\n|:----------------|:----------------|\r\n| 10:00               |  現地集合 |\r\n| 10:00 - 17:00   | チームごとに開発 |\r\n| 17:00 - 19:00   | 成果発表・フィードバック |\r\n| 19:00 - 19:30   | Donutsの紹介 |\r\n| 19:30 -            | どこかで打ち上げ |\r\n\r\n## つくるゲーム\r\n\r\nPCまたはスマホで動作するブラウザベースのゲームを作成します。\r\n\r\n## 目的\r\n\r\n* 企画力／技術力／チーム開発スキルの向上\r\n* 面白いゲームを作って世界中の人に遊んでもらおう！\r\n\r\n## 募集対象\r\n\r\nエンジニアメインになりますが、１から勉強するため、どなたでもご参加いただけます。\r\n\r\n* ゲームの企画をしたい人\r\n* デザインをしたい人\r\n* 開発をしたい人\r\n\r\nどしどしご参加ください！\r\n\r\n## 企画例\r\n\r\n* 後ほど追記\r\n\r\n　   \r\n-----  \r\n　  \r\n#### 株式会社Donutsでは、15卒の新卒およびインターン生を募集しています。\r\n\r\n（宣伝）\r\n\r\n\r\n[会場へのアクセスはこちら](http://www.donuts.ne.jp/about/access.html "アクセス")	30	1	10009739_687316187993150_6054107824003653431_n.jpg	2014-04-30 15:00:00	2014-05-01 15:00:00	http://	株式会社Donuts	JR線「渋谷駅」西口より徒歩5分	2014-05-15 18:39:09.033035	2014-06-01 10:18:16.607632
3	Swift勉強会	## 概要\r\nAppleから新しく発表されたプログラミング言語 SwiftでiPhoneアプリを開発しよう！\r\n詳細: https://developer.apple.com/swift/\r\n\r\n## 準備\r\n* Apple開発者アカウント\r\n* Xcode 6 beta\r\n* （任意で）Swiftで作ってみたアプリ等あればご持参ください。\r\n\r\n## 参加条件\r\n大学生〜社会人まで誰でもOK！	20	1	swift-hero.png	2014-06-07 04:00:00	2014-06-07 10:00:00	http://	皆大好きギブリー本社	渋谷区南平台町15－13帝都渋谷ビル８階（ https://givery.co.jp/corpinfo/access.html ）  渋谷駅より徒歩10分	2014-06-03 00:47:24.814278	2014-06-03 11:54:26.267981
4	第２回Swift勉強会	## 概要\r\n\r\n前回は、「2048」のゲームを作りました。\r\n\r\n今回は、前回のおさらい・補足をしてから（新規参加者が多いようなら、もう一度作り直すかも）、「2048」を解くAI（人工知能）を開発します。\r\n\r\n基本的なAIの作り方を講義し、全員で実践したあと、\r\n各自でブラッシュアップして、AIに出させた得点を競いましょう。\r\nなお、AIについては素人に毛が生えた程度なので、基本的に皆で考えるというスタンスです。\r\n\r\nSwiftについての解説も行います。\r\n\r\nまた、第１回に参加できなかった人も気軽に参加できるように準備をします。\r\nなので、Swiftが初めての方でも問題ありません。\r\n\r\n## タイムテーブル\r\n\r\n### 日程: **29日**\r\n\r\n| 時間                | 内容\r\n|:----------------|:----------------|\r\n| 13:00               | 会場集合 |\r\n| 19:00               | 解散 |\r\n\r\n## 目的\r\n\r\n* 強いアルゴリズムを考えて「頭」を鍛えよう！\r\n* 楽しもう！\r\n* Swiftとかいう言語を学ぼう！\r\n\r\n## 準備\r\n\r\n* Xcode6　\r\n* 何らかの言語の基本的な知識\r\n  * 配列とかfor文とかわかればオーケー！\r\n  * クラスを作ったことあればバッチリ。\r\n  * 無い人は勉強してから来てね！\r\n\r\n## 参加条件\r\n* 大学生または社会人\r\n* 中高生は申し訳ないけど、ダメです。\r\n\r\nどしどしご参加ください！\r\n	20	1	__________2014-06-09_23.22.28.png	2014-06-29 04:00:00	2014-06-29 10:00:00	http://	ドーナツ屋さん	渋谷区道玄坂1丁目10-8 渋谷道玄坂東急ビル6階	2014-06-09 14:32:41.523432	2014-06-23 11:17:46.711647
